private void hideContainerizationFields()
{
    var formDataObject = WHSContainerTable_ds.object(fieldNum(WHSContainerTable, ContainerBuildId));
    formDataObject.visible(false);
    formDataObject = WHSContainerTable_ds.object(fieldNum(WHSContainerTable, ErrorContainer));
    formDataObject.visible(false);
    formDataObject = WHSContainerTable_ds.object(fieldNum(WHSContainerTable, ParentContainerId));
    formDataObject.visible(false);
    formDataObject = WHSContainerTable_ds.object(fieldNum(WHSContainerTable, ContainerLevel));
    formDataObject.visible(false);
}

    public void init()
    {
        isWHSContainerTableCustomViewFilterFixFlightEnabed = WHSContainerTableCustomViewFilterFixFlight::instance().isEnabled();
        isWHSContainerTableCustomViewExtraFilterFixFlightEnabled = WHSContainerTableCustomViewExtraFilterFixFlight::instance().isEnabled();

        whsContainerTableForm = WHSContainerTableForm::construct();

        formViewType = element.args().parmEnum();

        if (element.args().dataset() == tableNum(WHSLoadTable))
        {
            loadId = element.args().record().(fieldNum(WHSLoadTable, LoadId));
            showShippedContainers = true;
        }
        else if (element.args().dataset() == tableNum(InventDim))
        {
            callerInventDim =  element.args().record();
        }

        super();

        if (loadId || formViewType == WHSContainerTableFormViewType::ClosedContainersOnPackingStation
				   || formViewType == WHSContainerTableFormViewType::OpenContainersOnPackingStation)
        {
            ShowClosed.visible(false);
        }

        if (formViewType == WHSContainerTableFormViewType::ContainersForShipment || formViewType == WHSContainerTableFormViewType::ClosedContainersOnPackingStation || formViewType == WHSContainerTableFormViewType::OpenContainersOnPackingStation)
        {
            element.hideContainerizationFields();
        }

        if (WHSContainerTableAllowMultipleContainersRemovingFlight::instance().isEnabled())
        {
            Header.multiSelect(true);
        }

        element.updateDesign(InventDimFormDesignUpdate::Init);
    }

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm inventDimParmLocal;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_WHSContainerTable::newFromForm(element);
                inventDimParmLocal.setAllProductDimensions();
            }

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public void close()
{
    Object caller = element.args().caller();

    if (caller is FormRun)
    {
        if (formHasMethod(caller, identifierStr(refreshFormAfterPacking)))
        {
            caller.refreshFormAfterPacking();
        }

        if (containersDeleted && formHasMethod(caller, identifierStr(resetSelectedContainer)))
        {
            caller.resetSelectedContainer();
        }
    }

    super();
}

private void buildQueryForPackingStation(QueryBuildDataSource _containerTableDS, WHSContainerStatus _containerStatus)
{
    _containerTableDS.clearDynalinks();

    _containerTableDS.addRange(fieldNum(WHSContainerTable, ContainerStatus)).value(queryValue(_containerStatus));

    var InventDimDS = _containerTableDS.addDatasource(tableNum(InventDim));
    InventDimDS.joinMode(JoinMode::InnerJoin);
    InventDimDS.relations(false);
    InventDimDS.addLink(fieldnum(WHSContainerTable, InventDimId), fieldnum(InventDim, InventDimId));

    InventDimDS.addRange(fieldNum(InventDim, InventLocationId)).value(queryValue(callerInventDim.InventLocationId));
    InventDimDS.addRange(fieldNum(InventDim, wMSLocationId)).value(queryValue(callerInventDim.wMSLocationId));
}

public boolean validateCanDeleteSelectedContainers()
{
    for (WHSContainerTable containerTable = WHSContainerTable_ds.getFirst(1) ? WHSContainerTable_ds.getFirst(1) :
        WHSContainerTable_ds.cursor(); containerTable; containerTable = WHSContainerTable_ds.getNext())
    {
        var isContainerPartOfCompletedManifest =
            containerTable.ShipCarrierTrackingNum
            || containerTable.displayContainerGroupTrackingNumber()
            || containerTable.MasterTrackingNum;

        if (containerTable.ContainerStatus == WHSContainerStatus::Closed
            || containerTable.ContainerBuildId
            || isContainerPartOfCompletedManifest
            || !containerTable.validateDelete())
        {
            return false;
        }
    }

    return true;
}

private void extendWHSShipmentTableQuery()
{
    if (!loadId)
    {
        qbrShipmentStatus = SysQuery::findOrCreateRange(WHSContainerTable_DS.query().dataSourceTable(tableNum(WHSShipmentTable)), fieldNum(WHSShipmentTable, ShipmentStatus));
        qbrShipmentStatus.value(SysQuery::valueNot(WHSShipmentStatus::Shipped));
    }

    if (ShowClosed.visible())
    {
        if (showShippedContainers)
        {
            qbrShipmentStatus.value(SysQuery::valueUnlimited());
        }
        else
        {
            qbrShipmentStatus.value(SysQuery::valueNot(WHSShipmentStatus::Shipped));
        }
    }
}

public void executeQuery()
{
    if (isWHSContainerTableCustomViewExtraFilterFixFlightEnabled
     && loadId
     && !qbrLoad)
    {
        qbrLoad = SysQuery::findOrCreateRange(WHSContainerTable_DS.query().dataSourceTable(tableNum(WHSShipmentTable)), fieldNum(WHSShipmentTable, LoadId));
        qbrLoad.value(loadId);                
    }

    if (isWHSContainerTableCustomViewFilterFixFlightEnabed)
    {
        element.extendWHSShipmentTableQuery();

        qbrContainerReleased = SysQuery::findOrCreateRange(this.queryBuildDataSource(), fieldNum(WHSContainerTable, ContainerReleased));

        if (ShowReleased.visible())
        {
            if (showReleased.checked())
            {
                qbrContainerReleased.value(SysQuery::valueUnlimited());
            }
            else
            {
                qbrContainerReleased.value(SysQuery::value(NoYes::No));
            }
        }
    }            

    super();
}

