public void init()
{
    super();

    QueryBuildDataSource containerTableDS = this.query().dataSourceTable(this.table());

    if (!isWHSContainerTableCustomViewExtraFilterFixFlightEnabled)
    {
        qbrShipmentId = containerTableDS.addRange(fieldNum(WHSContainerTable, ShipmentId));
        qbrContainerId = containerTableDS.addRange(fieldNum(WHSContainerTable, ContainerId));
        qbrContainerGroupLP = containerTableDS.addRange(fieldNum(WHSContainerTable, ContainerGroupingLicensePlateId));
    }             

    if (!isWHSContainerTableCustomViewFilterFixFlightEnabed)
    {
        qbrContainerReleased = containerTableDS.addRange(fieldNum(WHSContainerTable, ContainerReleased));
    }            

    if (formViewType != WHSContainerTableFormViewType::AllContainers)
    {
        qbrContainerBuildId = containerTableDS.addRange(fieldNum(WHSContainerTable, ContainerBuildId));
        qbrContainerBuildId.value(SysQuery::valueEmptyString());
    }

    if (formViewType == WHSContainerTableFormViewType::ClosedContainersOnPackingStation)
    {
        element.buildQueryForPackingStation(containerTableDS, WHSContainerStatus::Closed);
        element.hideContainerizationFields();
    }
    else if (formViewType == WHSContainerTableFormViewType::OpenContainersOnPackingStation)
    {
        element.buildQueryForPackingStation(containerTableDS, WHSContainerStatus::Open);
        element.hideContainerizationFields();
    }

    this.cacheAddMethod(tableMethodStr(WHSContainerTable, displayTotalFreight));
    this.cacheAddMethod(tableMethodStr(WHSContainerTable, displayLoadId));
    this.cacheAddMethod(tableMethodStr(WHSContainerTable, onHandLPLocation));
    this.cacheAddMethod(tableMethodStr(WHSContainerTable, displayContainerGroupTrackingNumber));

    this.object(fieldNum(WHSContainerTable, CloseContainerProfileId)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ContainerAttributeCode)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ContainerLevel)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ContainerReleased)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ContainerStatus)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ContainerTypeCode)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ErrorContainer)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, MasterTrackingNum)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ParentContainerId)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, ShipCarrierTrackingNum)).allowEdit(false);
    this.object(fieldNum(WHSContainerTable, Weight)).allowEdit(false);
}

