public void clicked()
{
    DialogButton releaseContainerGroup = DialogButton::Yes;

    if (WHSContainerTable::isThereAnOpenContainerRelatedToContainerGroup(whsContainerTable.ContainerGroupingLicensePlateId))
    {
        releaseContainerGroup = Box::yesNo(strFmt("@WAX:DialogTextReleaseContainerGroupWithOpenContainer", whsContainerTable.ContainerGroupingLicensePlateId), DialogButton::No);

        if (releaseContainerGroup == DialogButton::Yes)
        {
            WHSContainerTable::removeOpenContainersFromContainerGroup(whsContainerTable.ContainerGroupingLicensePlateId);
        }
    }

    if (releaseContainerGroup == DialogButton::Yes)
    {
        if (WHSCloseContainerProfile::find(WHSContainerTable.CloseContainerProfileId).ContainerClosingWorkCreationProcess == WHSWarehouseContainerClosingWorkCreationProcess::Automatic)
        {
            WHSContainerTable.releaseContainerWithWorkCreation();
        }
        else
        {
            super();
        }

        WHSContainerTable_ds.research(true);
    }
}

void clicked()
{
    if (WHSCloseContainerProfile::find(whsContainerTable.CloseContainerProfileId).ManifestRequirementsForContainer == WHSManifestRequirement::Manual)
    {
        whsContainerTable.unManifestContainerManual();
    }
    else
    {
        whsContainerTable.unmanifestContainerWithTransportationManagement();
    }

    WHSContainerTable_ds.research(true);
}

