public void clicked()
{
    if (WHSShipmentTable::doesContainerOnShipmentHasNonWorkCreationPackingPolicy(WHSContainerTable.ShipmentId))
    {
        throw error("@WAX:ShipmentCantBeReleasedAsItContainsContainersWithNonWorkCreationPolicies");
    }

    WHSShipmentTable::find(WHSContainerTable.ShipmentId).releaseContainersOnShipment();

    WHSContainerTable_ds.research(true);
}

public boolean modified()
