}

public boolean modified()
{
    boolean ret;

    ret = super();

    if (isWHSContainerTableCustomViewExtraFilterFixFlightEnabled
     && (!qbrShipmentId || !qbrContainerId || !qbrContainerGroupLP))
    {
        QueryBuildDataSource containerTableDS = WHSContainerTable_DS.query().dataSourceTable(tableNum(WHSContainerTable));

        if (!qbrShipmentId)
        {
            qbrShipmentId = SysQuery::findOrCreateRange(containerTableDS, fieldNum(WHSContainerTable, ShipmentId));
        }

        if (!qbrContainerId)
        {
            qbrContainerId = SysQuery::findOrCreateRange(containerTableDS, fieldNum(WHSContainerTable, ContainerId));
        }

        if (!qbrContainerGroupLP)
        {
            qbrContainerGroupLP = SysQuery::findOrCreateRange(containerTableDS, fieldNum(WHSContainerTable, ContainerGroupingLicensePlateId));
        }                
    }

    qbrShipmentId.value(SysQuery::valueUnlimited());
    qbrContainerId.value(SysQuery::valueUnlimited());
    qbrContainerGroupLP.value(SysQuery::valueUnlimited());

    if (WHSShipmentTable::exist(this.text()))
    {
        qbrShipmentId.value(queryValue(this.text()));                
    }
    else if (WHSContainerTable::findByContainerId(this.text()))
    {
        qbrContainerId.value(queryValue(this.text()));                
    }
    else if (WHSContainerTable::isLicensePlateIdUsedForContainerGrouping(this.text()))
    {
        qbrContainerGroupLP.value(queryValue(this.text()));
    }

    if (!isWHSContainerTableCustomViewExtraFilterFixFlightEnabled)
    {
        WHSShipmentTable_ds.executeQuery();
    }

    WHSContainerTable_ds.executeQuery();

    return ret;
}

